import React from 'react';

export interface TableHeadingProps {
  children?: any;
  maxWidth?: number;
}

const TableHeading: React.SFC<TableHeadingProps> = ({ maxWidth, children }) => {
  return (
    <th scope="col" style={{ maxWidth }}>
      {children}
    </th>
  );
};

export default TableHeading;
